(1, 1, '2023-04-06 09:33:42', '2023-04-06 06:33:42', '<!-- wp:paragraph -->\n<p>Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите ее, затем начинайте создавать!</p>\n<!-- /wp:paragraph -->', 'Привет, мир!', '', 'publish', 'open', 'open', '', '%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80', '', '', '2023-04-06 09:33:42', '2023-04-06 06:33:42', '', 0, 'http://kmns/?p=1', 0, 'post', '', 1),
